import React from 'react'

export default function Filter(props) {
  return (props.trigger) ? (
    <div>
        <input type="text" placeholder='state' onChange={(e)=> {
            setState(e.targe)
        }} />
        <input type="text" placeholder='city'/>
    </div>
  ) : "";
}
